// src/components/Navbar.js
import React from 'react';
import { Link } from 'react-router-dom';

const Navbar = () => {
  return (
    <nav style={{ padding: '1rem', backgroundColor: '#282c34' }}>
      <Link to="/" style={{ color: '#fff', marginRight: '1rem' }}>Intro</Link>
      <Link to="/algo/1" style={{ color: '#fff', marginRight: '1rem' }}>Algorithm 1</Link>
      <Link to="/algo/2" style={{ color: '#fff', marginRight: '1rem' }}>Algorithm 2</Link>
      <Link to="/algo/3" style={{ color: '#fff' }}>Algorithm 3</Link>
    </nav>
  );
};

export default Navbar;
